import React from 'react';
import './Grid.css';
import myGrid from './calc.js'

class Grid extends React.Component {

   render(){
      return(
         <div className='myGrid'>test</div>,
         <div className="Grid">
        {this.state.boxes.map((items) => {
          return (
            <div>
              {items.map((subItem) => {
                return <div className="gridBox">{subItem.i},{subItem.j}</div>;
              })}
            </div>
          );
        })}
      </div>


      );


   }

}

export default Grid;
